import {BrowserRouter as Router,Route,Routes} from "react-router-dom"
import './App.css';
import Home from "./components/Home";
function App() {
  return (
    <>
      <Router>
        <Routes>

        <Route path="/" component={Home} />
        </Routes>
      </Router>
    </>
  );
}

export default App;
